				["Code"] = "-- Error catcher\nfor k, v in pairs({\"ButtonFacade\", \"Masque\", \"Masque_ElvUIesque\", \"GSE\", \"Gnome Sequencer Enhanced\", \"Gnome Sequencer\"}) do    \n    if IsAddOnLoaded(v) then\n        message(\"Disable next addon: \" .. v)\n    end\nend\n-- Listener\nListener, listeners = {}, {}\nlocal frame = CreateFrame('Frame', 'Rubim_Events1')\nframe:SetScript('OnEvent', function(_, event, ...)\n        if not listeners[event] then return end\n        for k in pairs(listeners[event]) do\n            listeners[event][k](...)\n        end\nend)\nfunction Listener.Add(_, name, event, callback)\n    if not listeners[event] then\n        frame:RegisterEvent(event)\n        listeners[event] = {}\n    end\n    listeners[event][name] = callback\nend\nfunction Listener.Remove(_, name, event)\n    if listeners[event] then\n        listeners[event][name] = nil\n    end\nend\nfunction Listener.Trigger(_, event, ...)\n    onEvent(nil, event, ...)\nend\n-- Protector against FPS drop\noLastCall = { [\"global\"] = 0.2 } -- refresh interval for few lua funcs\nfunction fLastCall(obj)\n    if not oLastCall[obj] then\n        oLastCall[obj] = 0\n    end\n    return GetTime()>=oLastCall[obj]\nend\n\nfunction IconPrev(obj) --TellMeWhen_Group6_Icon21\n    --local val = string.match(tostring(obj), \"%d+\", 22) - 1    \n    --local format2 = .attributes.realAlpha\n    print(obj.Icon)\n    --return TellMeWhen_Group6_Icon .. .attributes.realAlpha==0\nend \n-- General \nlocal TMW = TMW\nlocal CNDT = TMW.CNDT\nlocal Env = CNDT.Env\nlocal InPvP_Status, InPvP_timestamp = false, 0\nTMW.CNDT.Env.Zone = \"none\"\nfor k, v in ipairs({\"PLAYER_ENTERING_WORLD\", \"PLAYER_ENTERING_BATTLEGROUND\", \"PLAYER_TARGET_CHANGED\", \"DUEL_FINISHED\", \"DUEL_REQUESTED\", \"ZONE_CHANGED\", \"ZONE_CHANGED_INDOORS\", \"ZONE_CHANGED_NEW_AREA\", \"PLAYER_FLAGS_CHANGED\"}) do    \n    Listener:Add('General_Events', v, function(...) \n            if GetTime()>InPvP_timestamp then\n                if v==\"PLAYER_TARGET_CHANGED\" then\n                    if \n                    (\n                        UnitIsPlayer(\"target\") and \n                        not UnitIsFriend(\"player\", \"target\") \n                    ) or Env.Buffs(\"player\", 269083)>0 then -- WPvP           \n                        InPvP_Status = true \n                    elseif CombatTime(\"player\")==0 then\n                        InPvP_Status = false\n                    end\n                else                     \n                    if v==\"DUEL_REQUESTED\" then\n                        InPvP_Status = true\n                    elseif \n                    (\n                        v==\"ZONE_CHANGED\" or\n                        v==\"ZONE_CHANGED_INDOORS\" or \n                        v==\"ZONE_CHANGED_NEW_AREA\" or\n                        v==\"PLAYER_ENTERING_WORLD\" or\n                        v==\"PLAYER_ENTERING_BATTLEGROUND\" or\n                        (\n                            v==\"PLAYER_FLAGS_CHANGED\" and\n                            ...==\"player\"\n                        )\n                    ) then\n                        local inst, zone = IsInInstance() -- select(2, IsInInstance()), select(1, GetZonePVPInfo())\n                        Env.Zone = zone\n                        InPvP_Status =\n                        (\n                            UnitInBattleground(\"player\")~=nil or \n                            select(1, IsActiveBattlefieldArena()) or \n                            --inst==\"pvp\" or \n                            --inst==\"arena\" or \n                            zone==\"pvp\" or \n                            zone==\"arena\" or \n                            --zone==\"combat\" or \n                            Env.Buffs(\"player\", 269083)>0 -- WPvP\n                        )                         \n                    else\n                        InPvP_Status = false\n                    end                                  \n                end \n                InPvP_timestamp = GetTime()               \n            end            \n    end)\nend\nfunction TMW.CNDT.Env.InPvP()    \n    return InPvP_Status\nend\n\n\n-- Stuff\nfunction round(num, numDecimalPlaces)\n    return tonumber(string.format(\"%.\" .. (numDecimalPlaces or 0) .. \"f\", num))\nend\n\nfunction dynamic_array(dimension)\n    local metatable = {}\n    for i=1, dimension do\n        metatable[i] = {__index = function(tbl, key)\n                if i < dimension then\n                    tbl[key] = setmetatable({}, metatable[i+1])\n                    return tbl[key]\n                end\n            end\n        }\n    end\n    return setmetatable({}, metatable[1]);\nend\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
