				["Name"] = "TMW Monitor",
				["Code"] = "local TMW = TMW\nlocal CNDT = TMW.CNDT\nlocal Env = CNDT.Env\nlocal isNumber = TMW.isNumber\nlocal strlowerCache = TMW.strlowerCache\nlocal huge = math.huge\nlocal LibRangeCheck = LibStub(\"LibRangeCheck-2.0\")\nlocal _, pclass = UnitClass(\"player\")\nlocal _, prace = UnitRace(\"player\")\nlocal gcd = 1.5/(1+UnitSpellHaste(\"player\")*0.01)\n\nfunction TMW.CNDT.Env.Buffs(unitID, spell, source, byId)\n    local filter = \"HELPFUL\"    \n    if source == \"player\" then\n        filter = filter .. \" \" .. \"PLAYER\"\n    end    \n    if type(spell)==\"table\" then         \n        for i, v in pairs(spell) do            \n            if not byId then\n                found, dur = Env.AuraDur(unitID, strlowerCache(GetSpellInfo(v)), filter)           \n            else \n                found, dur = Env.AuraDur(unitID, v, filter) \n            end              \n            if found > 0 then\n                break\n            end\n        end\n        return found, dur\n    elseif not byId then\n        return Env.AuraDur(unitID, strlowerCache(GetSpellInfo(spell)), filter)\n    else\n        return Env.AuraDur(unitID, spell, filter)\n    end   \nend\nfunction TMW.CNDT.Env.SortBuffs(unitID, spell, source, byId)\n    local oId = {{0, 0}} \n    local filter = \"HELPFUL\"    \n    if source == \"player\" then\n        filter = filter .. \" \" .. \"PLAYER\"\n    end    \n    if type(spell)==\"table\" then        \n        for i, v in pairs(spell) do\n            if not byId then\n                found, dur = Env.AuraDur(unitID, strlowerCache(GetSpellInfo(v)), filter)           \n            else \n                found, dur = Env.AuraDur(unitID, v, filter) \n            end\n            if found > 0 then\n                table.insert(oId, {found, dur}) \n            end            \n        end\n        ArraySortByColl(oId, 1)   \n        return oId[1][1], oId[1][2]            \n    elseif not byId then\n        return Env.AuraDur(unitID, strlowerCache(GetSpellInfo(spell)), filter)\n    else\n        return Env.AuraDur(unitID, spell, filter)\n    end   \nend\nfunction TMW.CNDT.Env.BuffStack(unitID, spell, source, byId)\n    local filter = \"HELPFUL\"    \n    if source == \"player\" then\n        filter = filter .. \" \" .. \"PLAYER\"\n    end\n    if not byId then\n        spell = strlowerCache(GetSpellInfo(spell))\n    end    \n    return Env.AuraStacks(unitID, spell, filter)\nend\n\nlocal function IDexception(spell)\n    local found = false \n    for k, v in pairs({\n            31117, -- Unstable Affliction\n            163505, -- Rake\n            96294, -- Chains of Ice\n            -- 203123, -- Maim\n            -- 236025, -- Enraged Maim\n    }) do\n        if spell == v then \n            found = true \n            break\n        end  \n    end    \n    return found\nend\nfunction TMW.CNDT.Env.DeBuffs(unitID, spell, source, byId)\n    local filter = \"HARMFUL\"    \n    if source == \"player\" then\n        filter = filter .. \" \" .. \"PLAYER\"\n    end    \n    if type(spell)==\"table\" then         \n        for i, v in pairs(spell) do\n            if not byId then\n                if IDexception(v) then \n                    found, dur = Env.AuraDur(unitID, v, filter)\n                else \n                    found, dur = Env.AuraDur(unitID, strlowerCache(GetSpellInfo(v)), filter)  \n                end                    \n            else \n                found, dur = Env.AuraDur(unitID, v, filter) \n            end            \n            if found > 0 then\n                break\n            end\n        end\n        return found, dur\n    elseif not byId and not IDexception(spell) then\n        return Env.AuraDur(unitID, strlowerCache(GetSpellInfo(spell)), filter)\n    else\n        return Env.AuraDur(unitID, spell, filter)\n    end   \nend\nfunction TMW.CNDT.Env.SortDeBuffs(unitID, spell, source, byId)\n    local oId = {{0, 0}} \n    local filter = \"HARMFUL\"    \n    if source == \"player\" then\n        filter = filter .. \" \" .. \"PLAYER\"\n    end    \n    if type(spell)==\"table\" then        \n        for i, v in pairs(spell) do\n            if not byId then\n                found, dur = Env.AuraDur(unitID, strlowerCache(GetSpellInfo(v)), filter)           \n            else \n                found, dur = Env.AuraDur(unitID, v, filter) \n            end   \n            if found > 0 then\n                table.insert(oId, {found, dur}) \n            end            \n        end\n        ArraySortByColl(oId, 1)   \n        return oId[1][1], oId[1][2]            \n    elseif not byId then\n        return Env.AuraDur(unitID, strlowerCache(GetSpellInfo(spell)), filter)\n    else\n        return Env.AuraDur(unitID, spell, filter)\n    end   \nend\nfunction TMW.CNDT.Env.DeBuffStack(unitID, spell, source, byId)\n    local filter = \"HARMFUL\"    \n    if source == \"player\" then\n        filter = filter .. \" \" .. \"PLAYER\"\n    end\n    if not byId then\n        spell = strlowerCache(GetSpellInfo(spell))\n    end    \n    return Env.AuraStacks(unitID, spell, filter)\nend\n\nfunction TMW.CNDT.Env.PT(unitID, spell, type, byId) \n    local filter = \"HELPFUL\"\n    if type == \"debuff\" then \n        filter = \"HARMFUL\"        \n    end    \n    filter = filter .. \" \" .. \"PLAYER\"    \n    if not byId then\n        spell = strlowerCache(GetSpellInfo(spell))\n    end      \n    return Env.AuraPercent(unitID, spell, filter)<=0.30    \nend\n\nfunction TMW.CNDT.Env.global_invisible()\n    return Env.Buffs(\"player\", {114018, 32612, 110959, 198158})>0\nend\n\nfunction TMW.CNDT.Env.TalentLearn(id)\n    return Env.TalentMap[strlowerCache[GetSpellInfo(id)]] or false\nend\nfunction TMW.CNDT.Env.PvPTalentLearn(id)\n    return Env.PvpTalentMap[strlowerCache[GetSpellInfo(id)]] or false\nend\n\n-- LUA Errors bug fix (+increased performance)\nlocal PlayerSpec = GetSpecializationInfo(GetSpecialization())\nfor k, v in pairs({\"PLAYER_ENTERING_WORLD\", \"ACTIVE_TALENT_GROUP_CHANGED\"}) do\n    Listener:Add('Player_Events', v, function()\n            PlayerSpec = GetSpecializationInfo(GetSpecialization())            \n    end)\nend\nfunction TMW.CNDT.Env.UNITSpec(unitID, specs)  \n    local found = false\n    if type(specs)==\"table\" then        \n        for i, v in pairs(specs) do\n            if unitID == \"player\" then\n                found = PlayerSpec == v\n            else\n                found = Env.UnitSpec(unitID) == v\n            end\n            \n            if found == true then\n                break\n            end\n        end       \n    else\n        if unitID == \"player\" then\n            found = PlayerSpec == specs\n        else\n            found = Env.UnitSpec(unitID) == specs \n        end       \n    end\n    return found or false\nend\nfunction TMW.CNDT.Env.UNITRace(unitID)\n    return select(2, Env.UnitRace(unitID))\nend\nfunction TMW.CNDT.Env.UNITLevel(unitID)\n    return Env.UnitLevel(unitID)   \nend\nfunction TMW.CNDT.Env.UNITEnemy(unitID)\n    return Env.UnitCanAttack(\"player\", unitID)\nend\nfunction TMW.CNDT.Env.UNITIsPlayer(unitID)\n    return Env.UnitIsPlayer(unitID)\nend\nfunction TMW.CNDT.Env.UNITAgro(unitID, otherunit)\n    local isTanking, status, threatpct, rawthreatpct, threatvalue = UnitDetailedThreatSituation(unitID, otherunit)\n    return isTanking or false\nend\nfunction TMW.CNDT.Env.UNITRange(unitID)\n    local _, range = LibRangeCheck:GetRange(unitID)\n    if not range then range = 0 end;\n    return range\nend\nfunction TMW.CNDT.Env.UNITCurrentSpeed(unitID)\n    return math.floor(GetUnitSpeed(unitID) / 7 * 100)\nend\nfunction TMW.CNDT.Env.UNITMaxSpeed(unitID)\n    return math.floor(select(2, GetUnitSpeed(unitID)) / 7 * 100)\nend\nfunction TMW.CNDT.Env.UNITDead(unitID)\n    return Env.UnitIsDeadOrGhost(unitID)\nend\n\nfunction TMW.CNDT.Env.SpellCD(spellID)\n    return Env.CooldownDuration(strlowerCache(GetSpellInfo(spellID)))\nend\nfunction TMW.CNDT.Env.SpellCharges(spellID)\n    local charges = Env.GetSpellCharges(GetSpellInfo(spellID))\n    if not charges then \n        charges = 0\n    end \n    return charges\nend\nfunction TMW.CNDT.Env.ChargesFrac(spellID)\n    local charges, maxCharges, start, duration = Env.GetSpellCharges(GetSpellInfo(spellID))\n    local oFrac = {[1]=duration, [2]=duration}\n    if charges ~= maxCharges then\n        oFrac[charges+1] = start - GetTime() + duration\n    else \n        for i = 1, #oFrac, 1 do\n            oFrac[i] = duration\n        end\n    end\n    if oFrac[1] ~= duration then\n        oFrac[2] = 0\n    end\n    return round((oFrac[1] + oFrac[2]) / duration, 1)\nend\nfunction TMW.CNDT.Env.SpellUsable(spell, offset)\n    local offset = offset or select(4, GetNetStats())\n    local spell = GetSpellInfo(spell)\n    return IsUsableSpell(spell) and Env.SpellCD(spell) <= offset\nend\nfunction TMW.CNDT.Env.SpellInRange(unit, id)    \n    return Env.IsSpellInRange(GetSpellInfo(id), unit)==1 or false   \nend\nfunction TMW.CNDT.Env.SpellInteract(unit, range)  \n    local cur_range = Env.UNITRange(unit)\n    -- Holy Paladin Talent Range buff +50%\n    if Env.UNITSpec(\"player\", 257) and Env.Buffs(\"player\", 214202, \"player\")>0 then range = range * 1.5 end;\n    -- Moonkin talent +5 yards\n    if Env.UNITSpec(\"player\", 102) and (Env.TalentLearn(22366) or Env.TalentLearn(22163)) then range = range + 5 end;    \n    return cur_range > 0 and cur_range <= range\nend\nfunction TMW.CNDT.Env.SpellExists(spell)   \n    local id = GetSpellInfo(spell)           \n    return Env.GetSpellBookItemInfo(id) or Env.IsPlayerSpell(spell)    \nend\n\nfunction TMW.CNDT.Env.GetPowerCost(spellID)\n    local cost = Env.GetSpellPowerCost(strlowerCache(GetSpellInfo(spellID)))[1][\"cost\"]\n    if cost then       \n        return cost\n    end      \n    return 0\nend\n\nfunction TMW.CNDT.Env.GCD()\n    if TMW.GCD > 0 then\n        gcd = TMW.GCD\n    end    \n    return gcd\nend\n\nfunction TMW.CNDT.Env.MyBurst(unit)\n    if not unit then unit=\"target\" end;\n    return Env.IsInInstance()==\"none\" or Env.UnitLevel(unit)==-1 or Env.UnitIsPlayer(unit)\nend\n\nlocal function PlayerCastingEnd()\n    local castingendtime = (select(5, UnitCastingInfo(\"player\"))) or 0\n    \n    if castingendtime > 0 then\n        return castingendtime / 1000 - GetTime()\n    end\n    \n    local channelendtime = (select(5, UnitChannelInfo(\"player\"))) or 0\n    \n    if channelendtime > 0 then\n        return channelendtime / 1000 - GetTime()\n    end\n    return 0\nend\n\nfunction TMW.CNDT.Env.ShouldStop()\n    if Env.CooldownDuration(\"gcd\") >= ((select(4, GetNetStats()) / 1000) * 2) then\n        return true\n    end    \n    if Env.LastPlayerCastID~=12051 and PlayerCastingEnd() >= ((select(4, GetNetStats()) / 1000) * 2) then\n        return true\n    end    \n    return false\nend\n\n-- Simcraft\nfunction TMW.CNDT.Env.execute_time(id) \n    -- Return GCD>CastTime or CastTime>GCD\n    local gcd, cast_time = Env.GCD(), Env.CastTime(id)     \n    if cast_time > gcd then\n        return cast_time \n    else\n        return gcd\n    end\nend\nfunction TMW.CNDT.Env.SpellHaste()\n    return 1 / (1 + (GetHaste() / 100))\nend\n\n-- Sort for high duration\nlocal function ArraySortByColl(array, col_number)\n    for j = 1, #array - 1 do\n        for i = 2, #array do\n            if array[i][col_number] > array[i-1][col_number] then\n                local x = array[i-1]\n                array[i-1] = array[i]\n                array[i] = x\n            end\n        end\n    end\nend\n\n-- Cast\nlocal prev_spellID, interruptpct\nfunction TMW.CNDT.Env.RandomKick(unitid)\n    if not unitid then unitid = \"target\" end;\n    local pct_castleft, spellID = select(3, Env.CastTime(nil, unitid))\n    if spellID then               \n        if spellID~=prev_spellID then        \n            interruptpct = math.random(38, 83)\n            prev_spellID = spellID\n        end    \n        return pct_castleft>=interruptpct\n    end  \n    return false\nend\n\nfunction TMW.CNDT.Env.CastTime(id, unitid)    \n    -- total cast time, current casting time left, current percent casting\n    if not unitid then unitid = \"player\" end;\n    local castName, _, _, castStartTime, castEndTime, _, _, notInterruptable, spellID = Env.UnitCastingInfo(unitid)\n    local castleft, pct_castleft, total = 0, 0, 0\n    if id then\n        total=select(4, GetSpellInfo(id))/1000\n    elseif castName then\n        total=(castEndTime-castStartTime)/1000 \n    end  \n    if castName and (not id or GetSpellInfo(id)==castName) then \n        castleft=(GetTime()*1000-castStartTime)/1000\n        pct_castleft=castleft*100/total\n    else\n        castleft=total\n    end\n    return total, total-castleft, pct_castleft, spellID\nend\n\n-- Items\nfunction TMW.CNDT.Env.UseItem(slot)    \n    local start, duration, enable = GetInventoryItemCooldown(\"player\", slot)    \n    if enable == 0 or start + duration - GetTime() > 0 then\n        return false\n    end    \n    return true\nend\n\n-- Racials\nlocal oRacials = {\n    Human = 59752, --Trinket\n    NightElf = 58984,\n    Dwarf = 20594, --Deff and Trinket\n    Gnome = 20589, --Trinket\n    Draenei = 28880, --Deff\n    Worgen = 68992, --Sprint\n    Orc = 33697, --DAMAGE\n    Troll = 26297, --DAMAGE\n    Scourge = 7744, --Trinket\n    Tauren = 20549, --CC\n    BloodElf = 28730, --DAMAGE and CC\n    Goblin = 69070, --Sprint\n    Pandaren = 107079, --CC\n    VoidElf = 256948, --Teleport \n    LightforgedDraenei = 255647, --DAMAGE\n    DarkIronDwarf = 265221, --DAMAGE and Trinket\n    HighmountainTauren = 255654, --CC and Sprint\n    Nightborne = 260364, --DAMAGE\n    [\"Mag'har\"] = 274738, --DAMAGE    \n}\nlocal uRace = {\n    DAMAGE = {\n        Orc = 33697, --DAMAGE\n        Troll = 26297, --DAMAGE\n        BloodElf = 28730, --DAMAGE\n        LightforgedDraenei = 255647, --DAMAGE\n        DarkIronDwarf = 265221, --DAMAGE\n        Nightborne = 260364, --DAMAGE\n        [\"Mag'har\"] = 274738, --DAMAGE \n    },\n    TRINKET = {\n        Human = 59752, \n        Dwarf = 20594,\n        Gnome = 20589,\n        Scourge = 7744,\n        DarkIronDwarf = 265221,\n    },\n    DEFF = {\n        Dwarf = 20594,\n        Draenei = 28880,\n    },\n    SPRINT = {\n        Worgen = 68992, \n        Goblin = 69070,\n        HighmountainTauren = 255654,\n    },\n    CC = {\n        Tauren = 20549,\n        BloodElf = 28730,\n        Pandaren = 107079,\n        HighmountainTauren = 255654, \n    },            \n}\nfunction TMW.CNDT.Env.SpellRace(type)\n    local id = oRacials[prace]    \n    if uRace[type][prace] and Env.SpellCD(id)==0 then  \n        if (prace == \"BloodElf\" or prace == \"Tauren\") and not AoE(8, 1) then \n            return false \n        end  \n        if type == \"TRINKET\" then \n            if prace == \"Human\" and Env.PvPDeBuffs(\"player\", \"Stuned\")==0 then\n                return false            \n            elseif prace == \"Dwarf\" and \n            Env.PvPDeBuffs(\"player\", \"Magic\")==0 and \n            Env.PvPDeBuffs(\"player\", \"Poison\")==0 and \n            Env.PvPDeBuffs(\"player\", \"Curse\")==0 then            \n                return false\n            elseif prcae == \"Scourge\" and \n            Env.PvPDeBuffs(\"player\", \"Fear\")==0 and \n            Env.PvPDeBuffs(\"player\", \"Sleep\")==0 and \n            Env.PvPDeBuffs(\"player\", \"Charmed\")==0 then \n                return false \n            end       \n        elseif type == \"SPRINT\" and Env.PvPDeBuffs(\"player\", \"Rooted\")>0 then \n            return false \n        end\n        if \n        (\n            prace == \"Gnome\" or \n            (\n                type == \"TRINKET\" and \n                prace == \"DarkIronDwarf\"\n            )\n        ) and \n        (\n            Env.PvPDeBuffs(\"player\", \"Rooted\")==0 or \n            Env.UNITCurrentSpeed(\"player\")>=100\n        ) then\n            return false\n        end                \n        return id\n    end\n    return false\nend\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
