			{
				["Name"] = "CombatTracker",
				["Code"] = "---\n--- DateTime: 03.08.2018\n---\n\nlocal Data = {}\n\nlocal Doubles = {\n    [3]   = 'Holy + Physical',\n    [5]   = 'Fire + Physical',\n    [9]   = 'Nature + Physical',\n    [17]  = 'Frost + Physical',\n    [33]  = 'Shadow + Physical',\n    [65]  = 'Arcane + Physical',\n    [127] = 'Arcane + Shadow + Frost + Nature + Fire + Holy + Physical',\n}\n\nlocal function addToData(GUID)\n    if not Data[GUID] then\n        Data[GUID] = {\n            -- Damage Taken\n            dmgTaken = 0,\n            dmgTaken_P = 0,\n            dmgTaken_M = 0,\n            hits_taken = 0,\n            lastHit_taken = 0,\n            -- Damage Done\n            dmgDone = 0,\n            dmgDone_P = 0,\n            dmgDone_M = 0,\n            hits_done = 0,\n            lastHit_done = 0,\n            lastHit_done = 0,\n            -- Healing taken\n            heal_taken = 0,\n            heal_hits_taken = 0,\n            heal_lasttime = 0,\n            -- Healing Done\n            heal_done = 0,\n            heal_hits_done = 0,\n            -- Absorb      \n            absorb_spells = dynamic_array(2),\n            --shared\n            combat_time = GetTime(),\n            spell_value = {}\n        }\n    end\nend\n\n--[[ This Logs the damage done for every unit ]]\nlocal logDamage = function(...)\n    local _,_,_, SourceGUID, _,_,_, DestGUID, _,_,_, spellID, _, school, Amount, a, b, c = CombatLogGetCurrentEventInfo()\n    -- Chat Output for Debugging\n    --  if SourceGUID == UnitGUID('player') then\n    --      print(spellID)\n    --  end\n    -- Mixed\n    \n    if Doubles[school] then\n        Data[DestGUID].dmgTaken_P = Data[DestGUID].dmgTaken_P + Amount\n        Data[DestGUID].dmgTaken_M = Data[DestGUID].dmgTaken_M + Amount\n        Data[SourceGUID].dmgDone_P = Data[SourceGUID].dmgDone_P + Amount\n        Data[SourceGUID].dmgDone_M = Data[SourceGUID].dmgDone_M + Amount\n        -- Pysichal\n    elseif school == 1  then\n        Data[DestGUID].dmgTaken_P = Data[DestGUID].dmgTaken_P + Amount\n        Data[SourceGUID].dmgDone_P = Data[SourceGUID].dmgDone_P + Amount\n        -- Magic\n    else\n        Data[DestGUID].dmgTaken_M = Data[DestGUID].dmgTaken_M + Amount\n        Data[SourceGUID].dmgDone_M = Data[SourceGUID].dmgDone_M + Amount\n    end\n    -- Totals\n    Data[DestGUID].dmgTaken = Data[DestGUID].dmgTaken + Amount\n    Data[DestGUID].hits_taken = Data[DestGUID].hits_taken + 1\n    Data[SourceGUID].dmgDone = Data[SourceGUID].dmgDone + Amount\n    Data[DestGUID].hits_done = Data[DestGUID].hits_done + 1\n    Data[SourceGUID][spellID] = ((Data[SourceGUID][spellID] or Amount) + Amount) / 2\nend\n\n--[[ This Logs the swings (damage) done for every unit ]]\nlocal logSwing = function(...)\n    local _,_,_, SourceGUID, _,_,_, GUID, _,_,_, Amount = CombatLogGetCurrentEventInfo()\n    Data[GUID].dmgTaken_P = Data[GUID].dmgTaken_P + Amount\n    Data[GUID].dmgTaken = Data[GUID].dmgTaken + Amount\n    Data[GUID].hits_taken = Data[GUID].hits_taken + 1\n    Data[SourceGUID].dmgDone_P = Data[SourceGUID].dmgDone_P + Amount\n    Data[SourceGUID].dmgDone = Data[SourceGUID].dmgDone + Amount\n    Data[SourceGUID].hits_done = Data[SourceGUID].hits_done + 1\nend\n\n--[[ This Logs the healing done for every unit\n         !!~counting selfhealing only for now~!!]]\nlocal logHealing = function(...)\n    local _,_,_, SourceGUID, _,_,_, DestGUID, _,_,_, spellID, _,_, Amount = CombatLogGetCurrentEventInfo()\n    if GetTime() ~= Data[DestGUID].heal_lasttime and Data[DestGUID].heal_taken ~= Data[DestGUID].heal_taken + Amount then\n        Data[DestGUID].heal_lasttime = GetTime()\n    end   \n    Data[DestGUID].heal_taken = Data[DestGUID].heal_taken + Amount\n    Data[DestGUID].heal_hits_taken = Data[DestGUID].heal_hits_taken + 1\n    Data[SourceGUID].heal_done = Data[SourceGUID].heal_done + Amount\n    Data[SourceGUID].heal_hits_done = Data[SourceGUID].heal_hits_done + 1\n    Data[SourceGUID][spellID] = ((Data[SourceGUID][spellID] or Amount) + Amount) / 2\nend\n\nlocal logAbsorb = function(...)\n    local _,_,_, SourceGUID, _,_,_, DestGUID, DestName,_,_, spellID, spellName,_, auraType, Amount = CombatLogGetCurrentEventInfo()\n    if auraType==\"BUFF\" and Amount then\n        Data[DestGUID].absorb_spells[spellName][\"Amount\"] = Amount      \n    end    \nend\n\nlocal remove_logAbsorb = function(...)\n    local _,_,_, SourceGUID, _,_,_, DestGUID, DestName,_,_, spellID, spellName,_, auraType, Amount = CombatLogGetCurrentEventInfo()\n    if auraType==\"BUFF\" and Amount then\n        Data[DestGUID].absorb_spells[spellName][\"Amount\"] = nil               \n    end\nend\n\nfunction getAbsorb(unit, spellID)\n    local GUID = UnitGUID(unit)\n    local absorb = 0\n    if not spellID then\n        absorb = UnitGetTotalAbsorbs(unit)\n    else\n        absorb = Data[GUID].absorb_spells[GetSpellInfo(spellID)][\"Amount\"] or 0\n    end        \n    return absorb\nend \n\n--[[ This Logs the last action done for every unit ]]\nlocal addAction = function(...)\n    local _,_,_, sourceGUID, _,_,_,_, destName, _,_,_, spellName = ...\n    if not spellName then return end\n    if sourceGUID == UnitGUID('player') then\n        --local icon = select(3, GetSpellInfo(spellName))\n        --ActionLog:Add('Spell Cast Succeed', spellName, icon, destName)\n    end\n    Data[sourceGUID].lastcast = spellName\nend\n\n--[[ These are the events we're looking for and its respective action ]]\nlocal EVENTS = {\n    ['SPELL_DAMAGE'] = logDamage,\n    ['DAMAGE_SHIELD'] = logDamage,\n    ['SPELL_PERIODIC_DAMAGE']   = logDamage,\n    ['SPELL_BUILDING_DAMAGE']   = logDamage,\n    ['RANGE_DAMAGE'] = logDamage,\n    ['SWING_DAMAGE'] = logSwing,\n    ['SPELL_HEAL'] = logHealing,\n    ['SPELL_PERIODIC_HEAL'] = logHealing,\n    ['SPELL_AURA_APPLIED'] = logAbsorb,   \n    ['SPELL_AURA_REFRESH'] = logAbsorb,  \n    ['SPELL_AURA_REMOVED'] = remove_logAbsorb,  \n    ['UNIT_DIED'] = function(...) Data[select(8, CombatLogGetCurrentEventInfo())] = nil end,\n    --['SPELL_CAST_SUCCESS'] = addAction\n}\n\n--[[ Returns the total ammount of time a unit is in-combat for ]]\nfunction CombatTime(UNIT)\n    if not UNIT then UNIT = \"player\" end;    \n    local GUID = UnitGUID(UNIT)\n    if not Data[GUID] and TMW.CNDT.Env.UnitAffectingCombat(\"player\") then\n        return 400\n    end    \n    if Data[GUID] and InCombatLockdown() then\n        local combatTime = (GetTime()-Data[GUID].combat_time)       \n        return combatTime              \n    end\n    return 0\nend\n\nfunction getDMG(UNIT)\n    local total, Hits, phys, magic = 0, 0, 0, 0\n    local GUID = UnitGUID(UNIT)\n    if Data[GUID] then\n        local time = GetTime()\n        -- Remove a unit if it hasnt recived dmg for more then 5 sec\n        if (time-Data[GUID].lastHit_taken) > 5 then\n            Data[GUID] = nil\n        else\n            local combatTime = CombatTime(UNIT)\n            total = Data[GUID].dmgTaken / combatTime\n            phys = Data[GUID].dmgTaken_P / combatTime\n            magic = Data[GUID].dmgTaken_M / combatTime\n            Hits = Data[GUID].hits_taken\n        end\n    end\n    return total, Hits, phys, magic\nend\n\nfunction getHEAL(UNIT)\n    local total, Hits = 0, 0\n    local GUID = UnitGUID(UNIT)   \n    if Data[GUID] then\n        local time = GetTime()\n        -- Remove a unit if it hasnt recived heal for more then 5 sec\n        if Data[GUID].heal_lasttime>0 and time-Data[GUID].heal_lasttime>5 then            \n            Data[GUID] = nil\n        else\n            local combatTime = CombatTime(UNIT)\n            Hits = Data[GUID].heal_hits_taken\n            if Hits<1 then Hits=1 end;\n            if combatTime==0 then combatTime=Hits end;\n            total = Data[GUID].heal_taken / combatTime                        \n            if Data[GUID].heal_lasttime==0 then Data[GUID].heal_lasttime = GetTime() end;            \n        end\n    end\n    return total, Hits      \nend\n\nfunction TimeToDie(unit)\n    if not unit then unit=\"target\" end;\n    local ttd = UnitHealthMax(unit)\n    local DMG, Hits = getDMG(unit)\n    if DMG >= 1 and Hits > 1 then\n        ttd = UnitHealth(unit) / DMG\n    end    \n    return ttd\nend\n\nfunction LastCast(_, unit)\n    local GUID = UnitGUID(unit)\n    if Data[GUID] then\n        return Data[GUID].lastcast\n    end\nend\n\nfunction SpellDamage(_, unit, spellID)\n    local GUID = UnitGUID(unit)\n    return Data[GUID] and Data[GUID][spellID] or 0\nend\n\nListener:Add('Rubim_Events1', 'COMBAT_LOG_EVENT_UNFILTERED', function(...)\n        local _, EVENT, _, SourceGUID, _,_,_, DestGUID = CombatLogGetCurrentEventInfo()\n        -- Add the unit to our data if we dont have it\n        addToData(SourceGUID)\n        addToData(DestGUID)\n        -- Update last  hit time\n        Data[DestGUID].lastHit_taken = GetTime()\n        Data[SourceGUID].lastHit_done = GetTime()\n        -- Add the amount of dmg/heak\n        if EVENTS[EVENT] then EVENTS[EVENT](...) end\nend)\n\nListener:Add('Rubim_Events1', 'PLAYER_REGEN_ENABLED', function()\n        if not InCombatLockdown() and not TMW.CNDT.Env.UnitAffectingCombat(\"player\") then\n            --print(\"reset bug\")            \n            wipe(Data)\n        end        \nend)\n\nListener:Add('Rubim_Events1', 'PLAYER_REGEN_DISABLED', function()\n        wipe(Data)\nend)\n\n--[[last5secs = 0\nfunction incdmg5secs(unit)\n    if UnitExists(unit) then\n        local pDMG = select(1, getDMG(unit))\n        last5secs = pMDG\n    end\n    return 0\nend    ]]\n\nfunction incdmg(unit)\n    if UnitExists(unit) then\n        local pDMG = select(1, getDMG(unit))\n        return pDMG\n    end\n    return 0\nend\n\nfunction incdmgphys(unit)\n    if UnitExists(unit) then\n        local pDMG = select(3, getDMG(unit))\n        return pDMG\n    end\n    return 0\nend\n\nfunction incdmgmagic(unit)\n    if UnitExists(unit) then\n        local mDMG = select(4, getDMG(unit))\n        return mDMG\n    end\n    return 0\nend\n\n\n\n\n\n\n\n",
			}, -- [3]
			{
				["Order"] = 4,
				["Name"] = "MultiUnits",
				["Code"] = "local TMW = TMW\nlocal CNDT = TMW.CNDT\nlocal Env = CNDT.Env\nlocal activeUnitPlates = dynamic_array(2)\nlocal function AddNameplate(unitID)\n    local nameplate = C_NamePlate.GetNamePlateForUnit(unitID)\n    local unitframe = nameplate.UnitFrame  \n    local reaction = \"friendly\"\n    if Env.UNITEnemy(unitID) then\n        reaction = \"enemy\"\n    end   \n    activeUnitPlates[reaction][unitframe] = unitID\nend\nlocal function RemoveNameplate(unitID)\n    local nameplate = C_NamePlate.GetNamePlateForUnit(unitID)\n    local unitframe = nameplate.UnitFrame   \n    activeUnitPlates[\"friendly\"][unitframe] = nil\n    activeUnitPlates[\"enemy\"][unitframe] = nil\nend\nlocal frame = CreateFrame(\"Frame\")\nframe:RegisterEvent(\"NAME_PLATE_UNIT_ADDED\")\nframe:RegisterEvent(\"NAME_PLATE_UNIT_REMOVED\")\nframe:RegisterEvent(\"PLAYER_ENTERING_WORLD\")\nframe:SetScript(\"OnEvent\", function(self, event, ...)\n        if event == \"NAME_PLATE_UNIT_ADDED\" then\n            local unitID = ...\n            AddNameplate(unitID)\n        end        \n        if event == \"NAME_PLATE_UNIT_REMOVED\" then\n            local unitID = ...\n            RemoveNameplate(unitID)\n        end        \n        if event == \"PLAYER_ENTERING_WORLD\" then\n            wipe(activeUnitPlates)\n        end\nend)\n-- Checking by spell\nlocal function GetMobsBySpell(count, spellId, reaction, ignore)\n    local totalmobs = 0\n    for reference, unit in pairs(activeUnitPlates[reaction]) do\n        if Env.SpellInRange(unit, spellId) then\n            totalmobs = totalmobs + 1\n            if not ignore and (Env.Zone==\"arena\" or Env.Zone==\"pvp\") then\n                if reaction == \"enemy\" and UnitIsPlayer(unit) and not UnitIsUnit(\"target\", unit) and Env.PvPDeBuffs(unit, \"BreakAble\")>0 then\n                    totalmobs = 0\n                    break \n                end                \n            elseif count > 0 and totalmobs >= count then                \n                break                \n            end              \n        end\n    end    \n    return totalmobs\nend\n-- Checking by range\nlocal function GetMobsByRange(count, range, reaction, ignore)\n    local totalmobs = 0\n    for reference, unit in pairs(activeUnitPlates[reaction]) do\n        if Env.SpellInteract(unit, range) then\n            totalmobs = totalmobs + 1\n            if not ignore and (Env.Zone==\"arena\" or Env.Zone==\"pvp\") then\n                if reaction == \"enemy\" and UnitIsPlayer(unit) and not UnitIsUnit(\"target\", unit) and Env.PvPDeBuffs(unit, \"BreakAble\")>0 then\n                    totalmobs = 0\n                    break \n                end                \n            elseif count > 0 and totalmobs >= count then                \n                break            \n            end        \n        end\n    end   \n    return totalmobs\nend\n-- Melee\nlocal mobs = { [\"friendly\"] = {}, [\"enemy\"] = {} }\nfunction AoE(count, num, type, ignore) \n    if not type then type = \"enemy\" end  \n    if not num then num = 40 end   \n    if Env.InPvP() or not mobs[type][num] or fLastCall(\"AoE\" .. num .. type) then  \n        if not Env.InPvP() and fLastCall(\"AoE\" .. num .. type) then\n            oLastCall[\"AoE\" .. num .. type] = GetTime() + oLastCall[\"global\"]\n        end        \n        if num <= 60 then\n            mobs[type][num] = GetMobsByRange(count, num, type, ignore)\n        else \n            mobs[type][num] = GetMobsBySpell(count, num, type, ignore)\n        end                         \n    end             \n    if count > 0 then\n        return mobs[type][num] and mobs[type][num]>=count\n    else\n        return mobs[type][num]\n    end    \nend\n-- Range\nlocal PLAYER = UnitName(\"player\")\nlocal oActiveEnemy, oTotal, oActiveTotal = dynamic_array(2), {}, {}\nListener:Add('Active_Enemies', \"COMBAT_LOG_EVENT_UNFILTERED\", function(...)\n        local ts, event, _, SourceGUID, SourceName,_,_, DestGUID, DestName,_,_, spellID = CombatLogGetCurrentEventInfo()\n        if \n        event == \"SPELL_DAMAGE\" and         \n        UnitIsPlayer(SourceName) and\n        UnitIsFriend(SourceName, PLAYER) and\n        UnitIsUnit(SourceName .. \"-target\", \"target\") and\n        DestGUID \n        then   \n            ts = round(ts, 0)                        \n            if oActiveEnemy[SourceGUID][\"prev_ts\"] ~= ts then                \n                oActiveEnemy[SourceGUID][\"prev_ts\"] = ts\n                if not oActiveEnemy[SourceGUID][\"GetTime\"] or\n                GetTime() - oActiveEnemy[SourceGUID][\"GetTime\"] > 3 then\n                    oActiveEnemy[SourceGUID][\"GetTime\"] = GetTime()\n                    oActiveEnemy[SourceGUID][\"counter\"] = nil \n                    oActiveEnemy[SourceGUID][\"counterCache\"] = 0\n                    oActiveEnemy[SourceGUID][\"units\"] = nil\n                    oActiveEnemy[SourceGUID][\"units\"] = {}\n                end  \n            end            \n            if oActiveEnemy[SourceGUID][\"prev_ts\"] == ts then\n                -- Check for copy unit\n                if oActiveEnemy[SourceGUID][\"units\"][DestGUID] then            \n                    return                       \n                end\n                local cCache = oActiveEnemy[SourceGUID][\"counterCache\"]+1\n                local counter = oActiveEnemy[SourceGUID][\"counter\"]\n                oActiveEnemy[SourceGUID][\"counterCache\"] = cCache               \n                if not counter or cCache > 1 then\n                    oActiveEnemy[SourceGUID][\"GetTime\"] = GetTime()\n                    oActiveEnemy[SourceGUID][\"counter\"] = cCache\n                    oTotal[SourceGUID] = cCache\n                end                    \n                oActiveEnemy[SourceGUID][\"units\"][DestGUID] = DestGUID        \n            end            \n        end        \nend)    \n\nfunction active_enemies()    \n    wipe(oActiveTotal)\n    -- Delete old units \n    if next(oActiveEnemy) then\n        for k, v in pairs(oActiveEnemy) do\n            -- Check not refreshed latest 3 sec\n            if v[\"GetTime\"] and GetTime() - v[\"GetTime\"] > 4.5 then\n                oActiveEnemy[k] = nil\n                oTotal[k] = nil  \n            else\n                -- Check for dead units\n                for k1, v1 in pairs(v[\"units\"]) do\n                    if TMW.CNDT.Env.UNITDead(v1) then\n                        oActiveEnemy[k][\"units\"][k1] = nil\n                        oTotal[k] = oTotal[k] - 1                           \n                    end                    \n                end                \n            end\n        end\n    end\n    -- Sort table\n    if next(oTotal) then\n        for k, v in pairs(oTotal) do\n            table.insert(oActiveTotal, v)\n        end\n        table.sort(oActiveTotal, function (a, b) return (a > b) end)\n        return oActiveTotal[1] or 0\n    end\n    return 0\nend\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
