irit\n        31850, -- Ardent Defender        \n        871, -- Shield Wall\n        118038, -- Die by the Sword        \n        104773, -- Unending Resolve\n        6940, -- Blessing of Sacrifice\n        108271, -- Astral Shift\n        5277, -- Evasion\n        102342, -- Ironbark\n        -- 1022, -- Blessing of Protection\n        74001, -- Combat Readiness\n        -- 31224, -- Cloak of Shadows\n        33206, -- Pain Suppression\n        47585, -- Dispersion\n        186265, -- Aspect of Turtle\n        -- 48792, -- Icebound Fortitude\n        115176, -- Zen Meditation\n        122783, -- Diffuse Magic\n        86659, -- Guardian of Ancient Kings\n        642, -- Divine Shield\n        45438, -- Ice Block\n        -- 498, -- Divine Protection\n        157913, -- Evanesce\n        115203, -- Fortifying Brew\n        22812, -- Barkskin\n        122278, -- Dampen Harm        \n        61336, -- Survival Instincts\n        45182, -- Cheating Death\n        198589, -- Blur    \n        196555, -- Netherwalk\n        243435, -- Fortifying Brew\n    },    \n    -- Damage buffs\n    Rage = {\n        18499, -- Berserker Rage\n        184361, -- Enrage\n    }, \n    DamageBuffs = {        \n        51690, -- Killing Spree\n        -- 79140, -- Vendetta (debuff)\n        121471, -- Shadow of Blades\n        185313, -- Shadow Dance\n        13750, -- Adrenaline Rush\n        191427, -- Metamorphosis\n        19574, -- Bestial Wrath\n        -- 193530, -- Aspect of the Wild (small burst)\n        266779, -- Coordinated Assault\n        193526, -- Trueshot\n        -- 5217, -- Tiger's Fury (small burst)\n        106951, -- Berserk \n        102560, -- Incarnation: Chosen of Elune\n        102543, -- Incarnation: King of the Jungle\n        190319, -- Combustion \n        12042, -- Arcane Power                \n        12472, -- Icy Veins\n        51271, -- Pillar of Frost\n        31884, -- Avenging Wrath\n        236321, -- Warbanner\n        107574, -- Avatar        \n        114050, -- Ascendance\n        113858, -- Dark Soul: Instability\n        267217, -- Nether Portal\n        113860, -- Dark Soul: Misery\n        137639, -- Storm, Earth, and Fire\n        152173, -- Serenity\n        -- 115080, -- Touhc of Death (debuff)\n    },\n    BurstHaste = {\n        90355, -- Ancient Hysteria\n        146555, -- Drums of Rage\n        178207, -- Drums of Fury\n        230935, -- Drums of the Mountain\n        2825, -- Bloodlust\n        80353, -- Time Warp\n        160452, -- Netherwinds\n        32182, -- Heroism\n    },\n    -- SOME SPECIAL\n    DamageDeBuffs = {\n        79140, -- Vendetta (debuff)\n        115080, -- Touhc of Death (debuff)\n        122470, -- KARMA\n    }, \n}\n-- DeBuffs (enemy)\nfunction TMW.CNDT.Env.PvPKarma(unit) -- true not appear\n    if Env.PvPUpdateGroup() and Env.Buffs(unit, 122470)>0 then \n        for i = 1, GetNumGroupMembers() do\n            local member = Env.PvPCache[\"group\"] .. i\n            if Env.DeBuffs(member, 25771)>=20 then \n                return true \n            end \n        end\n        return false \n    end\n    return true\nend\nfunction TMW.CNDT.Env.PvPDeBuffs(unit, type)\n    -- 78675, -- Solar Beam (only master aur or Blessing of Spellwarding can dispel it)\n    if Env.DeBuffs(unit, 33786)>0 then -- Cyclone\n        return -1\n    end\n    return Env.DeBuffs(unit, oDebuffs[type])    \nend\n-- BUFFS (friendly)\nfunction TMW.CNDT.Env.PvPBuffs(unit, type)     \n    if Env.Buffs(unit, 33786)>0 then -- Cyclone\n        return -1\n    end\n    return Env.Buffs(unit, oDebuffs[type])      \nend\n-- Kick \n--[[\nfunction TMW.CNDT.Env.PvPKick(unit, type)\n    if type == \"physic\" then \n    elseif type == \"magic\" then \n    end\nend\n]]\n-- DamagerBurst\nfunction TMW.CNDT.Env.PvPUseBurst(unit)\n    if not unit then local unit = \"target\" end;\n    return \n    Env.InPvP() and \n    (\n        Env.UNITEnemy(unit) and UnitIsPlayer(unit) and \n        (\n            Env.Zone == \"none\" or \n            TimeToDie(unit) <= 4 or\n            (\n                Env.PvPUnitIsHealer(unit) and \n                (\n                    Env.PvPDeBuffs(unit, \"Silenced\") > 3 or \n                    Env.PvPDeBuffs(unit, \"Stuned\") > 3 or\n                    (\n                        TimeToDie(unit) <= 6 and \n                        Env.PvPBuffs(unit, \"DeffBuffs\") == 0                             \n                    )\n                )\n            ) or \n            Env.PvPAssist() or \n            (\n                Env.Zone == \"arena\" and \n                Env.PvPEnemyHealerInCC(4)\n            )\n        )                    \n    )\nend\nfunction TMW.CNDT.Env.PvPNeedDeff(unit)\n    if not unit then local unit = \"player\" end;\n    return Env.InPvP() and (Env.PvPEnemyBurst(unit, true) or TimeToDie(unit)<6 or Env.PvPDeBuffs(unit, \"DamageDeBuffs\")>5 or Env.PvPExecuteRisk(unit))\nend\nfunction TMW.CNDT.Env.PvPTargeting(unit)\n    local count = 0\n    if Env.InPvP() and Env.PvPUpdatePvPGroup() then\n        for i = 1, Env.PvPCache[\"PvPgroup\"] do\n            local arena = \"arena\" .. i\n            if UnitIsUnit(arena .. \"target\", unit) and Env.UNITSpecs(arena, {251, 252, 577, 102, 103, 253, 254, 255, 62, 63, 64, 269, 70, 258, 259, 260, 261, 262, 263, 71, 72}) then \n                count = count + 1\n            end\n        end\n    end \n    return count > 0 and (Env.Zone == \"arena\" or count >= Env.PvPCache[\"PvPgroup\"] * 0.3)\nend\nfunction TMW.CNDT.Env.PvPExecuteRisk(unit)\n    if CombatTime(\"player\") == 0 then \n        return false \n    end \n    local check = false    \n    if Env.PvPUpdatePvPGroup() and UnitHealth(unit) <= UnitHealthMax(unit)*0.21 then\n        for i = 1, Env.PvPCache[\"PvPgroup\"] do\n            local arena = \"arena\" .. i\n            if (Env.UnitSpec(arena)==71 or Env.UnitSpec(arena)==72) and UnitIsUnit(arena .. \"target\", unit) and Env.UnitPower(unit)>=20 and (unit ~= \"player\" or Env.UNITRange(arena)<7) then \n                check = true \n                break\n            end\n        end\n    end\n    return check\nend\n-- Helper\nTMW.CNDT.Env.PvPCache = {}\nfor k, v in pairs({\"GROUP_ROSTER_UPDATE\", \"ARENA_OPPONENT_UPDATE\"}) do\n    Listener:Add('Player_Events', v, function()\n            if next(Env.PvPCache) then \n                wipe(Env.PvPCache)\n            end\n            Env.PvPUpdateGroup()\n            Env.PvPUpdatePvPGroup()\n            Env.PvPReturnFriendlyHealerUnitID()\n    end)\nend\nfunction TMW.CNDT.Env.PvPEnemyBurst(unit, checkdeff) -- Retrives true if some one bursting our UNIT \n    if CombatTime(\"player\") == 0 then \n        return false \n    end \n    local check = false\n    if Env.PvPUpdateGroup() and Env.PvPUpdatePvPGroup() then \n        if unit == \"HEALER\" then             \n            if Env.PvPCache[\"group\"] == \"raid\" then \n                for i = 1, GetNumGroupMembers() do\n                    local member = Env.PvPCache[\"group\"] .. i\n                    if not UnitIsUnit(member, \"player\") and UnitGroupRolesAssigned(member)==\"HEALER\" then \n                        for i = 1, Env.PvPCache[\"PvPgroup\"] do\n                            local arena = \"arena\" .. i\n                            if UnitIsUnit(arena .. \"target\", member) and not Env.PvPUnitIsHealer(arena) and Env.PvPBuffs(arena, \"DamageBuffs\")>0 and (not checkdeff or Env.PvPBuffs(member, \"DeffBuffs\")==0) then -- if damager or tank\n                                check = true \n                                break \n                            end\n                        end\n                    end\n                end\n            elseif Env.PvPCache[\"group\"] == \"party\" and Env.PvPReturnFriendlyHealerUnitID() then \n                for i = 1, Env.PvPCache[\"PvPgroup\"] do\n                    local arena, member = \"arena\" .. i, Env.PvPCache[\"FriendlyHealerUnitID\"]\n                    if UnitIsUnit(arena .. \"target\", member) and not Env.PvPUnitIsHealer(arena) and Env.PvPBuffs(arena, \"DamageBuffs\")>0 and (not checkdeff or Env.PvPBuffs(member, \"DeffBuffs\")==0) then\n                        check = true\n                        break\n                    end\n                end\n            end\n        else\n            for i = 1, Env.PvPCache[\"PvPgroup\"] do\n                local arena, member = \"arena\" .. i, unit\n                if UnitIsUnit(arena .. \"target\", member) and not Env.PvPUnitIsHealer(arena) and Env.PvPBuffs(arena, \"DamageBuffs\")>0 and (not checkdeff or Env.PvPBuffs(member, \"DeffBuffs\")==0) then\n                    check = true \n                    break\n                end\n            end\n        end\n    end\n    return check\nend\nfunction TMW.CNDT.Env.PvPEnemyHealerInCC(duration)\n    if CombatTime(\"player\") == 0 then \n        return false \n    end \n    if not duration then local duration = 3 end;\n    local check = 0 \n    if Env.PvPUpdatePvPGroup() and Env.PvPCache[\"PvPgroup\"] > 0 then \n        for i = 1, Env.PvPCache[\"PvPgroup\"] do \n            local arena = \"arena\" .. i\n            if not UnitIsUnit(arena, \"target\") and Env.PvPUnitIsHealer(arena) then -- If we don't target that healer\n                check = Env.DeBuffs(arena, {51514, 33786, 19386, 2637}) -- Hex, Cyclone, Wyvern Sting, Sleep \n                if check >= duration then \n                    break \n                end                                                        -- Other types\n                for k, v in pairs({\"Stuned\", \"Silenced\", \"Fear\", \"CrowdControl\", \"Incapacitated\", \"Disoriented\", \"Charmed\"}) do \n                    check = Env.PvPDeBuffs(arena, v)\n                    if check >= duration then \n                        break \n                    end                     \n                end                \n            end\n        end \n    end\n    return check >= duration\nend\nfunction TMW.CNDT.Env.PvPFriendlyHealerInCC(duration)\n    if CombatTime(\"player\") == 0 then \n        return false \n    end \n    if not duration then local duration = 3 end;    \n    local check = 0 \n    if Env.PvPUpdateGroup() then \n        if Env.PvPCache[\"group\"] == \"raid\" then                                                     -- BG\n            for i = 1, GetNumGroupMembers() do \n                local member = Env.PvPCache[\"group\"] .. i\n                if not UnitIsUnit(member, \"player\") and UnitGroupRolesAssigned(member)==\"HEALER\" then \n                    check = Env.DeBuffs(member, {51514, 33786, 19386, 2637})     -- Hex, Cyclone, Wyvern Sting, Sleep \n                    if check >= duration then \n                        break \n                    end                                                            -- Other types\n                    for k, v in pairs({\"Stuned\", \"Silenced\", \"Fear\", \"CrowdControl\", \"Incapacitated\", \"Disoriented\", \"Charmed\"}) do \n                        check = Env.PvPDeBuffs(member, v)\n                        if check >= duration then \n                            break \n                        end                     \n                    end    \n                end\n            end    \n        elseif Env.PvPCache[\"group\"] == \"party\" and Env.PvPReturnFriendlyHealerUnitID() then        -- ARENA\n            check = Env.DeBuffs(Env.PvPCache[\"FriendlyHealerUnitID\"], {51514, 33786, 19386, 2637})     -- Hex, Cyclone, Wyvern Sting, Sleep \n            if check < duration then                                                             -- Other types\n                for k, v in pairs({\"Stuned\", \"Silenced\", \"Fear\", \"CrowdControl\", \"Incapacitated\", \"Disoriented\", \"Charmed\"}) do \n                    check = Env.PvPDeBuffs(Env.PvPCache[\"FriendlyHealerUnitID\"], v)\n                    if check >= duration then \n                        break \n                    end                     \n                end\n            end    \n        end\n    end \n    return check >= duration\nend\nfunction TMW.CNDT.Env.PvPReturnFriendlyHealerUnitID() -- Usage only for arena \n    if CombatTime(\"player\") == 0 then \n        return false \n    end     \n    if not Env.PvPCache[\"FriendlyHealerUnitID\"] and Env.PvPUpdateGroup() then    \n        for i = 1, GetNumGroupMembers() do \n            local member = Env.PvPCache[\"group\"] .. i\n            if not UnitIsUnit(member, \"player\") and UnitGroupRolesAssigned(member)==\"HEALER\" then \n                Env.PvPCache[\"FriendlyHealerUnitID\"] = member \n                break\n            end\n        end\n    end \n    if Env.PvPCache[\"FriendlyHealerUnitID\"] then \n        return Env.PvPCache[\"FriendlyHealerUnitID\"]\n    else\n        return false\n    end \nend\nfunction TMW.CNDT.Env.PvPUpdateGroup()\n    if not Env.PvPCache[\"group\"] then \n        if IsInRaid() then\n            Env.PvPCache[\"group\"] = \"raid\"\n        elseif IsInGroup() then\n            Env.PvPCache[\"group\"] = \"party\"    \n        end\n    end    \n    if Env.PvPCache[\"group\"] then \n        return true \n    else \n        return false \n    end \nend \nfunction TMW.CNDT.Env.PvPUpdatePvPGroup()\n    if not Env.PvPCache[\"PvPgroup\"] then \n        if Env.Zone == \"arena\" then \n            Env.PvPCache[\"PvPgroup\"] = GetNumArenaOpponentSpecs()\n        elseif Env.Zone == \"pvp\" then\n            Env.PvPCache[\"PvPgroup\"] = GetNumBattlefieldScores()\n        end\n    end    \n    if Env.PvPCache[\"PvPgroup\"] then \n        return true \n    else \n        return false \n    end \nend \nfunction TMW.CNDT.Env.PvPUnitIsHealer(unit)\n    local check = false \n    for k, v in pairs({105, 270, 65, 256, 257, 264}) do \n        -- local id = GetInspectSpecialization(unit)\n        if Env.UnitSpec(unit) == v then \n            check = true\n            break \n        end\n    end \n    return check \nend\nfunction TMW.CNDT.Env.PvPAssist() -- Help mate who burst your target\n    if CombatTime(\"player\") == 0 then \n        return false \n    end \n    local check = false    \n    if Env.PvPUpdateGroup() then \n        for i = 1, GetNumGroupMembers() do \n            local member = Env.PvPCache[\"group\"] .. i\n            if not UnitIsUnit(member, \"player\") and UnitGroupRolesAssigned(member)==\"DAMAGER\" and UnitIsUnit(member .. \"target\", \"target\") and Env.PvPBuffs(member, \"DamageBuffs\")>8 then \n                check = true \n                break\n            end\n        end\n    end \n    return check\nend \n-- BreakAble \nfunction TMW.CNDT.Env.PvPBreakAble(range)\n    local check = false \n    if Env.PvPUpdateGroup() and Env.Zone == \"arena\" then \n        for i = 1, Env.PvPCache[\"PvPgroup\"] do\n            local arena = \"arena\" .. i\n            if Env.UNITRange(arena)<=range and Env.PvPDeBuffs(arena, \"BreakAble\")>0 and not UnitIsUnit(\"target\", arena) then\n                check = true \n                break\n            end            \n        end\n    end    \n    return check \nend\n\n\n-- LOS CHECK (GCD Spells only)\nlocal InLOS, LOSUnit, InLOSCache = dynamic_array(2), nil, {}\nListener:Add('PvP_Events', \"COMBAT_LOG_EVENT_UNFILTERED\", function()\n        -- Reset LOS for unit if spell has been casted on him        \n        if LOSCheck then\n            local _, event, _, SourceGUID, _,_,_, DestGUID = CombatLogGetCurrentEventInfo()\n            if event==\"SPELL_CAST_SUCCESS\" and SourceGUID==UnitGUID(\"player\") and next(InLOSCache) then \n                for k, v in pairs(InLOSCache) do\n                    if v and DestGUID==UnitGUID(v) then\n                        InLOS[v][\"unit_time\"] = nil\n                        InLOS[v][\"unit_LOS\"] = nil\n                        if LOSUnit==v then \n                            LOSUnit = nil\n                        end\n                    end \n                end                 \n            end            \n        end\nend)\nListener:Add('PvP_Events', \"UI_ERROR_MESSAGE\", function(...)\n        if LOSCheck and ...==50 and LOSUnit and not InLOS[LOSUnit][\"unit_LOS\"] and InLOS[LOSUnit][\"unit_time\"] and GetTime()>=InLOS[LOSUnit][\"unit_time\"] then\n            InLOS[LOSUnit][\"unit_LOS\"] = GetTime()+3.5 --Skip for 3.5sec    \n            InLOSCache[LOSUnit] = LOSUnit\n            --InLOS[LOSUnit] = LOSUnit\n        end\nend)\nfunction GetLOS(unit) -- Physical button call   \n    if LOSCheck and TMW.GCD==0 and (not InLOS[unit][\"unit_LOS\"] or GetTime()>=InLOS[unit][\"unit_LOS\"]) and (not InLOS[unit][\"unit_time\"] or GetTime()>=InLOS[unit][\"unit_time\"]+0.3) then\n        LOSUnit = unit\n        InLOS[unit][\"unit_time\"] = GetTime()+0.3 --start time (0.3 delay added to skip wrong event from another key)\n        InLOS[unit][\"unit_LOS\"] = nil --reset skip time since now we need again check if he's in los\n    end\nend\nfunction TMW.CNDT.Env.InLOS(unit)\n    return LOSCheck and InLOS[unit][\"unit_LOS\"] and GetTime()<InLOS[unit][\"unit_LOS\"]\nend\n\n\n\n\n\n\n",
