       Icon6 = {\"Freedom\", \"Kick1\", \"Disarm1\"},\n        Icon7 = {\"Freedom\", \"Kick2\", \"Disarm2\", \"Dispel\"},\n        Icon8 = {\"Freedom\", \"Kick3\", \"Disarm3\", \"Dispel\"},\n    }, \n    DRUID = {\n        Icon6 = {\"Kick1\", \"Thorns\", \"Renewal\", \"Barkskin\", \"SurvivalInstincts\"},\n        Icon7 = {\"Kick2\", \"Thorns\", \"Dispel\"},\n        Icon8 = {\"Kick3\", \"Thorns\", \"Dispel\"},\n    }, \n    DEMONHUNTER = {\n        Icon6 = {\"Kick1\", \"ReverseMagic\", \"Netherwalk\", \"Darkness\", \"Blur\"},\n        Icon7 = {\"Kick2\"},\n        Icon8 = {\"Kick3\"},\n    }, \n    DEATHKNIGHT = {\n        Icon6 = {\"Kick1\", \"RaiseDead\", \"AMS\", \"DeathPact\", \"Zone-AntiMagic\"},\n        Icon7 = {\"Kick2\"},\n        Icon8 = {\"Kick3\"},\n    }, \n}\n\nfor k, v in ipairs({\"CHAT_MSG_PARTY\", \"CHAT_MSG_PARTY_LEADER\", \"CHAT_MSG_SAY\"}) do    \n    Listener:Add('MSG_Events', v, function(...) \n            if not MSG_Toggle then return end\n            local msg, _, _, name = ...\n            for ICON, v in pairs(EventTextList[pclass]) do\n                for k, MESSAGE in pairs(v) do\n                    if strmatch(msg, MESSAGE)==MESSAGE then  \n                        local cu = strmatch(MESSAGE, \"raid%d+\")\n                        if not cu then                            \n                            oMSG[ICON] = MESSAGE                           \n                        elseif \n                        (ICON==\"Icon6\" and UnitIsUnit(\"player\", cu)) or\n                        (ICON==\"Icon7\" and UnitIsUnit(\"party1\", cu)) or\n                        (ICON==\"Icon8\" and UnitIsUnit(\"party2\", cu))\n                        then                            \n                            oMSG[ICON] = select(1, gsub(MESSAGE, \"%s\"..cu, \"\", 1))\n                        else\n                            return\n                        end    \n                        starttime = GetTime()\n                        frame:Show()\n         