				["Code"] = "local AzeriteTraits = {}\nfor k,v in pairs({\"PLAYER_ENTERING_WORLD\", \"PLAYER_EQUIPMENT_CHANGED\", \"SPELLS_CHANGED\"}) do\n    Listener:Add('Azerite_Events', v, function()     \n            local AzeriteEmpoweredItem = _G.C_AzeriteEmpoweredItem\n            local AzeriteItems = {}        \n            for _, ID in pairs({ 1, 3, 5 }) do\n                AzeriteItems[ID] = Item:CreateFromEquipmentSlot(ID)\n            end\n            wipe(AzeriteTraits)            \n            for _, item in pairs(AzeriteItems) do\n                if not item:IsItemEmpty() then\n                    local itemLoc = item:GetItemLocation()\n                    if AzeriteEmpoweredItem.IsAzeriteEmpoweredItem(itemLoc)\n                    then\n                        local tierInfos =\n                        AzeriteEmpoweredItem.GetAllTierInfo(itemLoc);\n                        for _, tierInfo in pairs(tierInfos) do\n                            for _, powerId in pairs(tierInfo.azeritePowerIDs)\n                            do\n                                if\n                                AzeriteEmpoweredItem.IsPowerSelected(itemLoc, powerId) \n                                then\n                                    local spellIDAzerite =\n                                    GetSpellInfo(C_AzeriteEmpoweredItem.GetPowerInfo(powerId).spellID);\n                                    if not AzeriteTraits[spellIDAzerite] then\n                                        AzeriteTraits[spellIDAzerite] = 1\n                                    else\n                                        AzeriteTraits[spellIDAzerite] =\n                                        AzeriteTraits[spellIDAzerite] + 1;\n                                    end                                    \n                                end\n                            end\n                        end\n                    end\n                end\n            end       \n    end)\nend\n\nfunction AzeriteRank(spellID)\n    local rank = AzeriteTraits[GetSpellInfo(spellID)]\n    if not rank then rank = 0 end\n    return rank\nend",
